import React from "react";
import "./component-styles/card.css";

const RadioButton = ({ label, value, onChange }) => {
  return (
    <label>
      <input type="radio" checked={value} onChange={onChange} />
      {label}
    </label>
  );
};

const Airlines = () => {
  const [catPerson, setCatPerson] = React.useState(false);
  const [dogPerson, setDogPerson] = React.useState(false);

  const handleCatChange = () => {
    setCatPerson(!catPerson);
  };

  const handleDogChange = () => {
    setDogPerson(!dogPerson);
  };

  return (
    <div className="Card">
      <RadioButton label="Cat" value={catPerson} onChange={handleCatChange} />
      <RadioButton label="Dog" value={dogPerson} onChange={handleDogChange} />
    </div>
  );
};

export default Airlines;
